func Start1() {
	nest.PublicConfig.PartPartSpacing = 0
	nest.PublicConfig.BinPartSpacing = 0
	nest.PublicConfig.IfDebug = false
	nest.PublicConfig.IfDraw = true
	nest.PublicConfig.LoopMaxNum = 100000
	nest.PublicConfig.RunTimeOut = 150
	nest.PublicConfig.Rotations = 8
	mySVG := nest.NewSVG(nest.PublicConfig)
	mySVG.SetBinPoly(nest.NewPoly([]*point.Point{
		&point.Point{X: 0, Y: 0},
		&point.Point{X: 1000, Y: 0},
		&point.Point{X: 570, Y: 570},
		&point.Point{X: 0, Y: 1000},
	}))
	mySVG.AddPoly(nest.NewPoly([]*point.Point{
		&point.Point{X: 0, Y: 0},
		&point.Point{X: 130, Y: 0},
		&point.Point{X: 130, Y: 130},
		&point.Point{X: 0, Y: 130},
	}), 5)
	mySVG.AddPoly(nest.NewPoly([]*point.Point{
		&point.Point{X: 190, Y: 0},
		&point.Point{X: 200, Y: 0},
		&point.Point{X: 200, Y: 570},
		&point.Point{X: 190, Y: 570},
	}), 1)

	mySVG.Start()
	myPol := mySVG.GetPolByID(1)
	for j := range myPol.RootPoly.EndPolygon {
		log.Printf("%f,%f\n", myPol.RootPoly.EndPolygon[j].X, myPol.RootPoly.EndPolygon[j].Y)
	}
	log.Println(mySVG.Best)
}
